import Carousel from 'react-bootstrap/Carousel'
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import Picture from '../../Photos/bus2.png';
import Picture2 from '../../Photos/landscape1.jpg';

function DarkVariantExample() {
    return (
        <div className='card'>
        <div
        className='carousel'>
      <Carousel variant="dark">
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={Picture}
            alt="First slide"
          />
          
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={Picture2}
            alt="Second slide"
          />
         
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={Picture2}
            alt="Third slide"
          />
         
        </Carousel.Item>
      </Carousel>
      </div>
      </div>
    );
  }
  
  export default DarkVariantExample;
